Battle Moon Wars
Company: Werk
Release date: Jan 01, 2005
Rating: All Ages
Genre: SRPG
Language: English subtitled

Summary: Similar to the Super Robot Wars series except uses Type-Moon visual novel characters, such as Tsukihime, Fate/stay night and several original characters made exclusive by Werk. This game is an SRPG (or TRPG), not a visual novel.


